import React from 'react';
import logo from './logo.svg';
import './App.css';

function playSound() {
  console.log('play a sound');
  var audio = new Audio('c./all_1.wav');
  audio.play();
}

function App() {
  return (
    <button onClick={playSound}>
      Sound 1
    </button>
  );
}

export default App;
